            <div className="bannerImgDiv">
               <Image src={image} rounded alt="banner" height={550} width={600}>
               </Image>
            </div>
            <div class="introDiv">Lorem ipsum dolor sit amet, consectetur adipiscing elit. Integer elementum diam lacus, magnis. Diam tempus lorem laoreet mattis orci sagittis velit. Amet scelerisque diam non quis amet adipiscing.</div>
            
        </Container>
    );

}

